import React from 'react'
import './style.css'

export default class EnterNewTitle extends React.Component{
    constructor(){
        super()
    }
    render(){
        return (
            <div className='input-and-save'>
                <form>
                    <input className='input-title' type='text' placeholder='Enter the new title here...' />
                    <button className='save-btn'>Save changes</button>
                </form>
            </div>
        )
    }
}
